import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

public class NameFileFilterTest {

    @Test
    public void fileNameFilteringIsCaseInsensitive() {
        List<String> allowedFileNames = Arrays.asList("test.txt", "example.log", "mixed.case");

        NameFileFilter caseInsensitiveFilter = new NameFileFilter(allowedFileNames, IOCase.INSENSITIVE);

        boolean resultExactMatch = caseInsensitiveFilter.accept(null, "Test.TXT");
        Assertions.assertTrue(resultExactMatch);

        boolean resultUppercase = caseInsensitiveFilter.accept(null, "EXAMPLE.LOG");
        Assertions.assertTrue(resultUppercase);

        boolean resultMixedCase = caseInsensitiveFilter.accept(null, "MiXeD.CaSe");
        Assertions.assertTrue(resultMixedCase);

        boolean resultUnapproved = caseInsensitiveFilter.accept(null, "unapproved.file");
        Assertions.assertFalse(resultUnapproved);
    }
}

