import static org.junit.jupiter.api.Assertions.assertTrue;
import static org.mockito.Mockito.mock;
import static org.mockito.Mockito.when;

public class NameFileFilterTest1 {

    private FileSelectInfo createFileSelectInfo(final String baseName) throws Exception {
        final FileName fileName = mock(FileName.class);
        when(fileName.getBaseName()).thenReturn(baseName);

        final FileObject fileObject = mock(FileObject.class);
        when(fileObject.getName()).thenReturn(fileName);

        final FileSelectInfo fileSelectInfo = mock(FileSelectInfo.class);
        when(fileSelectInfo.getFile()).thenReturn(fileObject);

        return fileSelectInfo;
    }

    @Test
    public void testAcceptCaseSensitive() throws Exception {
        // Setup: Create a list of filenames
        final List<String> filenameList = Arrays.asList("file1.txt", "file2.txt");

        // Setup: Instantiate the filter with case-sensitive mode
        final NameFileFilter nameFileFilter = new NameFileFilter(IOCase.SENSITIVE, filenameList);

        // Test 1: Uppercase variant of the first filename (should be rejected)
