        final FileSelectInfo unlistedFileSelectionInfo = createFileSelectInfo("other.txt");
        final boolean rejectionResult3 = nameFileFilter.accept(unlistedFileSelectionInfo);
        assertFalse(rejectionResult3, "Filter should reject a filename not in the list.");
    }
}

