    }

    @Test
    public void testNameFileFilterCaseInsensitive() {
        // Step 0 & 1: Create a case-insensitive filter
        NameFileFilter caseInsensitiveFilter = new NameFileFilter(IOCase.INSENSITIVE, new String[]{"test_file.txt"});

        // Step 2 & 3: Apply the filter to a file with a completely different name
