class Http5FileSystemConfigBuilderTest {

    @Test
    void testHttp5FileSystemConfigBuilder() {
        // Setup
        FileSystemOptions fileSystemOptions = new FileSystemOptions();
        Http5FileSystemConfigBuilder configBuilder = Http5FileSystemConfigBuilder.getInstance();

        // Initial State Verification
        assertEquals(0, configBuilder.getConnectionTimeout(fileSystemOptions));
