        assertEquals(0, configBuilder.getSoTimeout(fileSystemOptions));
        assertEquals("Jakarta-Commons-VFS", configBuilder.getUserAgent(fileSystemOptions));

        // Configuration with Deprecated Methods
        configBuilder.setConnectionTimeout(fileSystemOptions, 60000);
        configBuilder.setSoTimeout(fileSystemOptions, 60000);
        String customUserAgentString = "custom-user-agent";
        configBuilder.setUserAgent(fileSystemOptions, customUserAgentString);

