import static org.junit.jupiter.api.Assertions.assertFalse;
import static org.junit.jupiter.api.Assertions.assertTrue;

public class FileSystemManagerTest {

    @Test
    public void testResolveFileAsFile() throws Exception {
        StandardFileSystemManager fileSystemManager = new StandardFileSystemManager();
        FileObject temporary_workspace_location = null;
        FileObject base_location = null;
        FileObject resolved_file_reference = null;
        File testDir = new File(System.getProperty("java.io.tmpdir"), "vfs-test");

        try {
            // Setup
            fileSystemManager.setFilesCache(new NullFilesCache());
            fileSystemManager.setReplicator(new DefaultFileReplicator(testDir));
            fileSystemManager.init();

            temporary_workspace_location = fileSystemManager.resolveFile(testDir.getAbsolutePath());
            temporary_workspace_location.deleteAll();

            base_location = temporary_workspace_location;
            fileSystemManager.setBaseFile(base_location);

            // When
            resolved_file_reference = fileSystemManager.resolveFile("res://test-data/test.zip");

            // Then
            boolean is_file = resolved_file_reference.isFile();
            assertTrue(is_file);

        } finally {
            // Teardown
            if (base_location != null) {
                base_location.close();
            }
            System.gc();
            if (fileSystemManager != null) {
                fileSystemManager.freeUnusedResources();
                fileSystemManager.close();
            }
            Thread.sleep(1000);
            if (temporary_workspace_location != null) {
                boolean workspace_exists = temporary_workspace_location.exists();
                assertFalse(workspace_exists);
            }
            VFS.close();
        }
    }
