    @Test
    public void testResolveFileWithPartialPath() throws Exception {
        // Steps 1, 2, 3: Initialize the file system manager.
        StandardFileSystemManager fileSystemManager = new StandardFileSystemManager();
        fileSystemManager.init();

        // Step 0: Ensure a designated temporary location exists as an empty directory.
        FileObject tempWorkspace = fileSystemManager.resolveFile("tmp:///test-area");
        tempWorkspace.deleteAll();
        tempWorkspace.createFolder();

        // Step 4: Prepare base folders for read and write operations.
        FileObject readFolder = fileSystemManager.resolveFile("tmp:///read-tests");
        readFolder.createFolder();
        FileObject writeFolder = fileSystemManager.resolveFile("tmp:///write-tests");
        writeFolder.createFolder();
        FileObject baseFolder = fileSystemManager.resolveFile("tmp:///");

        // Step 5: Confirm the read location exists and is not at the root level.
        Assertions.assertTrue(readFolder.exists());
        Assertions.assertNotEquals(readFolder.getName(), readFolder.getFileSystem().getRoot().getName());

        // GIVEN: Create a file named 'test-data' inside the read folder.
        FileObject testDataFile = readFolder.resolveFile("test-data");
        testDataFile.createFile();

        // WHEN: Resolve the 'test-data' file from the read folder.
        FileObject resolvedFileReference = fileSystemManager.resolveFile(readFolder, "test-data");

        // THEN: Assert the resolved reference represents a regular file.
        Assertions.assertTrue(resolvedFileReference.isFile());

        // Teardown
        // Step 9: Close the read, write, and base folder references.
        testDataFile.close();
        resolvedFileReference.close();
        readFolder.close();
        writeFolder.close();
        baseFolder.close();
        tempWorkspace.close();

        // Step 10: Trigger resource cleanup to free cached files.
        fileSystemManager.freeUnusedResources();

        // Step 11: Wait for concurrent operations to finish.
        Thread.sleep(100);

        // Step 12: Close the file system manager.
        fileSystemManager.close();

        // Step 13: Wait for remaining threads to complete.
        Thread.sleep(100);

        // Step 15: Close the global file system context.
