    private FileObject writeFolder;

    @BeforeEach
    public void setUp() throws Exception {
        // Step 0: Create a temporary directory
        temporaryDirectoryPath = Files.createTempDirectory("vfs-test");
        File temporaryDirectory = temporaryDirectoryPath.toFile();

        // Step 3: Instantiate a new file system manager
        fileSystemManager = new DefaultFileSystemManager();

        // Step 4 & 5: Configure files cache
        fileSystemManager.setFilesCache(fileSystemManager.getFilesCache());

        // Step 6: Instantiate a default file replicator
        DefaultFileReplicator defaultFileReplicator = new DefaultFileReplicator(temporaryDirectory);

        // Step 7: Wrap in a privileged replicator
        PrivilegedFileReplicator privilegedReplicator = new PrivilegedFileReplicator(defaultFileReplicator);

        // Step 8: Assign replicator and temporary file store
        fileSystemManager.setReplicator(privilegedReplicator);
        fileSystemManager.setTemporaryFileStore(defaultFileReplicator);

        // Add providers
        fileSystemManager.addProvider("ram", new RamFileProvider());
        // Step 9: Conditionally add local file provider
        if (!fileSystemManager.hasProvider("file")) {
            fileSystemManager.addProvider("file", new DefaultLocalFileProvider());
        }
        // Step 10: Register ResourceFileProvider
        fileSystemManager.addProvider("res", new ResourceFileProvider());

        // Step 11: Initialize the file system manager
        fileSystemManager.init();

        // Set the singleton manager
        VFS.setManager(fileSystemManager);

        // Clean and prepare the temporary directory
        FileObject tempFileObject = fileSystemManager.resolveFile(temporaryDirectory.toURI().toString());
        // Step 1: Clean the temporary directory
        tempFileObject.deleteAll();
        tempFileObject.createFolder();
        // Step 2: Confirm the temporary directory is empty
        assertEmpty(tempFileObject);

        // Step 12: Retrieve and resolve the base test folder
        String baseFolderUri = System.getProperty("test.basedir", "ram:///");
        baseTestFolder = fileSystemManager.resolveFile(baseFolderUri);
        // Ensure base folder exists for test purposes
        baseTestFolder.createFolder();

        // Step 13: Resolve child folders
        readFolder = baseTestFolder.resolveFile("read");
        readFolder.createFolder(); // Create folder to make it exist
        writeFolder = baseTestFolder.resolveFile("write");
        writeFolder.createFolder();

        // Step 14: Assert the read folder exists
        Assertions.assertTrue(readFolder.exists());

        // Step 15: Assert the read folder is not the root path
        Assertions.assertFalse(readFolder.getName().getDepth() == 0);
    }

    @Test
    public void testResolveUri() throws Exception {
        // Step 16: Resolve the URI 'res:test-data'
        FileName rootFileName = fileSystemManager.resolveURI("res:test-data");

        // Step 17: Resolve a file object from the root file name
        FileObject rootFileObject = fileSystemManager.resolveFile(rootFileName.getURI());

        // Step 18: Resolve the relative name 'test.zip'
        FileObject resolvedFileObject = rootFileObject.resolveFile("test.zip");

        // Step 19: Assert the resolved file object is not null
        Assertions.assertNotNull(resolvedFileObject);

        // Step 20: Assert the resolved file object exists
        Assertions.assertTrue(resolvedFileObject.exists());
    }

    @AfterEach
    public void tearDown() throws Exception {
        // Step 21: Close file objects
        if (readFolder != null) {
            readFolder.close();
        }
        if (writeFolder != null) {
            writeFolder.close();
        }
        if (baseTestFolder != null) {
            baseTestFolder.close();
        }

        // Step 22: Trigger garbage collection
        System.gc();
        Thread.sleep(100);
        System.gc();
        Thread.sleep(100);
        System.gc();
        Thread.sleep(100);

        // Step 23: Close the file system manager
        if (fileSystemManager != null) {
            fileSystemManager.close();
        }

        // Step 24: Pause to allow threads to terminate
        Thread.sleep(1000);

        // Step 25: Validate the temporary directory is empty or removed
        File tempFile = temporaryDirectoryPath.toFile();
        Assertions.assertTrue(!tempFile.exists() || tempFile.list().length == 0);

        // Step 26: Close the VFS singleton
        VFS.close();
    }

    private void assertEmpty(final FileObject folder) throws FileSystemException {
        Assertions.assertTrue(folder.exists());
        Assertions.assertTrue(folder.isFolder());
        Assertions.assertEquals(0, folder.getChildren().length);
    }
}

