import com.jcraft.jsch.ChannelSftp;
import com.jcraft.jsch.JSchException;
import com.jcraft.jsch.Session;

public class SftpIpv6Test {

    /**
     * Mock SFTP channel.
     */
    private static class MockChannelSftp extends ChannelSftp {
        // empty
    }

    /**
     * A custom SFTP provider that injects a mock JSch session.
     */
    private static class MockSftpProviderWithMockSession extends SftpFileProvider {
        @Override
        protected FileSystem doCreateFileSystem(final org.apache.commons.vfs2.FileName rootName,
                final FileSystemOptions fileSystemOptions) throws FileSystemException {
            final GenericFileName genericFileName = (GenericFileName) rootName;
            try {
                final Session mockSession = mock(Session.class);
                doNothing().when(mockSession).connect(anyInt());
                when(mockSession.openChannel(anyString())).thenReturn(new MockChannelSftp());

                return new SftpFileSystem(genericFileName, mockSession, fileSystemOptions);
            } catch (final JSchException e) {
                throw new FileSystemException(e);
            }
        }
    }

    @Test
    public void testResolveIpv6Url() throws FileSystemException {
        final DefaultFileSystemManager manager = (DefaultFileSystemManager) VFS.getManager();
        final String ipv6Url = "sftp://user:pass@[fe80::1c42:dae:8370:aea6%en1]/file.txt";

        try {
            manager.addProvider("sftp", new MockSftpProviderWithMockSession());

            final FileObject fileObject = manager.resolveFile(ipv6Url, new FileSystemOptions());

            assertEquals("sftp://user:pass@[fe80::1c42:dae:8370:aea6%en1]/",
                    fileObject.getFileSystem().getRootURI());
            assertEquals("sftp://user:pass@[fe80::1c42:dae:8370:aea6%en1]/file.txt",
                    fileObject.getName().getURI());
        } finally {
            // Restore the original provider
            manager.removeProvider("sftp");
            manager.addProvider("sftp", new SftpFileProvider());
        }
    }
}

